n_workers), performance_report(filename=f\"dask_performance_report_{n_workers}.html\"):\n        \n        evaluation_delayed = evaluate_model_dask(model, val_loader)\n        elapsed_time, (images_savings, labels_savings, probs_savings, preds_savings, accuracy) = evaluation_delayed.compute()\n        results.append((n_workers, elapsed_time, accuracy))\n        print(f\"Number of workers: {n_workers}, Elapsed time: {elapsed_time}\")\n\n# Shutdown Dask client and cluster\nclient.close()\ncluster.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1995","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1639","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1637","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1638","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1649"},"y_scale":{"type":"object","name":"LinearScale","id":"p1650"},"title":{"type":"object","name":"Title","id":"p1642","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1679","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1634","attributes":{"selected":{"type":"object","name":"Selection","id":"p1635","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1636"},"data":{"type":"map","entries":[["start",[]],["duration",[]],["key",[]],["name",[]],["color",[]],["duration_text",[]],["worker",[]],["y",[]],["worker_thread",[]],["alpha",[]]]}}},"view":{"type":"object","name":"CDSView","id":"p1680","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p1681"}}},"glyph":{"type":"object","name":"Rect","id":"p1676","attributes":{"x":{"type":"field","field":"start"},"y":{"type":"field","field":"y"},"width":{"type":"field","field":"duration"},"height":{"ty
